import React from 'react';
import Hello from './Hello';
import Wrapper from './Wrapper';
import './App.css';
function App() {

  return(
    <Wrapper>
      <Hello color="pink" name="반갑습니다" isSpecial={true}/>
      <Hello color="black"/>
    </Wrapper>
  );
}

export default App;
